import Layout from "../components/MyLayout";

export default function Index() {
  return (
    <Layout>
      <p>
        About pagemport withLayout from '../components/MyLayout'; const Page =
        () => <p>This is the about page</p>; export default withLayout(Page);
      </p>
    </Layout>
  );
}
